import React  from 'react';

const Header = () => {
    return ( 
        <nav>

            <div>
                <ul>
                    <li>About</li>
                    <li>Team</li>
                    <li>Service</li>
                    <li>Contact</li>
                </ul>
            </div>
        </nav> 
    );
}

export default Header;
